  From National Oceanic and Atmospheric Administration (NOAA) Survey H11346 of the
  Sea Floor in the Vicinity of Edgartown Harbor, Massachusetts (H11346_2MSSS_UTM19.TIF,
  UTM Zone 19, NAD83)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 10,\n\t\t\"recent\":
